import React from 'react';

const Header = () => {
  return (
    <header>
      <h1>Autos Force</h1>
      <nav>
        <ul>
          <li><a href="/">Inicio</a></li>
          <li><a href="/autos">Autos</a></li>
          <li><a href="/contacto">Contacto</a></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
